import React from 'react';
import { DragPreviewImage, useDrag } from 'react-dnd';
import { shipTypes } from './shipTypes';
import  veneKuva from "./veneKuva.png"

const veneStyle = {
    fontSize: 10,
    fontWeight: 'bold',
    cursor: 'move',
};
export const Vene = () => {
    const [{ isDragging }, drag, preview] = useDrag({
        item: { type: shipTypes.Vene },
        collect: (monitor) => ({
            isDragging: !!monitor.isDragging(),
        }),
    });
    return (<>
			<DragPreviewImage connect={preview} src={veneKuva}/>
			<div ref={drag} style={{
        ...veneStyle,
        opacity: isDragging ? 0.5 : 1,
    }}>
				<img src={veneKuva} height="100px" width="75px" alt="VeneKuva"/>
			</div>
		</>);
};
export default Vene;
